import "./style.css"
import arrow from "../../images/arrow.svg"

var page = 1
var length = 1

export default function Caroussel(props) {
    const imgs = props.imgs

    return (
        <div className="caroussel">
            {imgs.map((items, key) => {
                console.log(length)
                length++
                if (key == page) {
                    return (
                        <div>
                            <img key={key} className="carousselImg" src={items}></img>
                            <div onClick={() => {Inc()}} className="arrow"><img src={arrow}></img></div>
                        </div>
                    )
                }
            })}
        </div>
    )
}

function Inc() {
    if (page <= length) {
        page++
        console.log(page)
    } else {
        page = 1
    }
}
